import React, { useEffect } from 'react';

const Coffee = () => {


  useEffect(() => {
     Axios.post("http://localhost:4000/coffee").then((response) => {
              coffee1: Black;
              coffee2: Hot;
              coffee3: Cold;
            
            }).then((response) => {
              //console.log("coffee is successful uploaded!");
              console.log(response.data);
            })
          console.log("coffee is inserver successful!");
        //  console.log("Return back to login page");
        //  navigation.navigate('LoginScreen');
          //}    
     //});
   }, []);


    return (
        <div>
            <h1>Coffee</h1>

        </div>
    );
}

export default Coffee;
